import React from 'react';
import {Grid, Button, Icon, Menu} from 'semantic-ui-react';

class Feed extends React.Component {
	render(){
		const friends = {'Alex': ['Bricco', 'Strega'], 'Emilio': ['Tbaar brookline', 'Mikes pastry']}
	return (

		<div>
		<br></br>
		<p>Alex updated his restaurant list</p>
		<Grid columns={1}>
      	<Grid.Column>
		<Menu.Item as='a' onClick = {this.props.searchFriendChoice.bind(this, 'Bricco')}>  </Menu.Item>
		<Menu.Item as='a' onClick = {this.props.searchFriendChoice.bind(this, 'Strega')}>  </Menu.Item>
		</Grid.Column>
		</Grid>
		</div>

		);
}
}


export default Feed
